                        {
                            errorMask?.PushIndex((int)Quest_FieldIndex.Priority);
                            if (Mutagen.Bethesda.Binary.ByteBinaryTranslation.Instance.Parse(
                                frame: dataFrame.Spawn(snapToFinalPosition: false),
