        public override void SetNthMask(int index, object obj)
        {
            Quest_FieldIndex enu = (Quest_FieldIndex)index;
            switch (enu)
            {
                case Quest_FieldIndex.Script:
                    this.Script = (Exception)obj;
                    break;
                case Quest_FieldIndex.Name:
                    this.Name = (Exception)obj;
